import React from 'react'
import {
    SidebarContainer,
    Icon,
    CloseIcon
} from './SidebarElements'

export const Sidebar = () => {
    return (
        <SidebarContainer>
            <Icon>
                <CloseIcon />
            </Icon>
        </SidebarContainer>
    )
}
